import styled from '@emotion/styled';

export const FilterBlock = styled.label`
  display: block;
  margin-bottom: 10px;
`;

export const InputFilter = styled.input`
  display: block;
  margin-top: 10px;
  border: 2px solid;
  border-radius: 4px;
  height: 20px;
`;
